            <div class="form-group">
                <label for="pais">País</label>
                <div class="select-container">
                  <select id="pais" class="form-select" name="pais" required>
                        <option value="" selected disabled>Seleccione un país</option>
                  </select>
                </div>
                <div class="error-message">Por favor selecciona tu país</div>
            </div>

            <!-- Departamento -->
            <div class="form-group">
                <label for="departamento">Departamento</label>
                <div class="select-container">
                  <select id="departamento" class="form-select" name="departamento" required>
                       <option value="" selected disabled>Seleccione un departamento</option>
                  </select>
                </div>
                <div class="error-message">Por favor selecciona tu departamento</div>
            </div>

