                    d="M618.953 38.2585C617.574 38.2585 616.346 38.0215 615.269 37.5476C614.198 37.0675 613.351 36.4089 612.73 35.5717C612.114 34.7285 611.797 33.7559 611.779 32.6541H615.804C615.829 33.1158 615.98 33.522 616.257 33.8729C616.54 34.2176 616.915 34.4853 617.383 34.6761C617.851 34.867 618.377 34.9624 618.962 34.9624C619.571 34.9624 620.11 34.8546 620.578 34.6392C621.045 34.4238 621.412 34.1252 621.676 33.7436C621.941 33.362 622.073 32.9219 622.073 32.4233C622.073 31.9186 621.932 31.4723 621.649 31.0845C621.372 30.6906 620.972 30.3828 620.448 30.1612C619.931 29.9396 619.316 29.8288 618.602 29.8288H616.838V26.8928H618.602C619.205 26.8928 619.737 26.7881 620.199 26.5788C620.667 26.3696 621.03 26.0803 621.289 25.7109C621.547 25.3355 621.676 24.8984 621.676 24.3999C621.676 23.9259 621.563 23.5104 621.335 23.1534C621.113 22.7902 620.799 22.5071 620.393 22.304C619.993 22.1009 619.525 21.9993 618.99 21.9993C618.448 21.9993 617.952 22.0978 617.503 22.2947C617.054 22.4856 616.694 22.7595 616.423 23.1165C616.152 23.4735 616.007 23.892 615.989 24.3722H612.157C612.176 23.2827 612.487 22.3224 613.09 21.4915C613.693 20.6605 614.505 20.0111 615.527 19.5433C616.555 19.0694 617.715 18.8324 619.008 18.8324C620.313 18.8324 621.455 19.0694 622.434 19.5433C623.412 20.0173 624.172 20.6574 624.714 21.4638C625.262 22.264 625.533 23.1626 625.527 24.1598C625.533 25.2185 625.203 26.1018 624.539 26.8097C623.88 27.5175 623.021 27.9669 621.963 28.1577V28.3054C623.354 28.4839 624.412 28.9671 625.139 29.755C625.871 30.5367 626.234 31.5154 626.228 32.6911C626.234 33.7682 625.924 34.7254 625.296 35.5625C624.674 36.3996 623.815 37.0582 622.72 37.5384C621.624 38.0185 620.368 38.2585 618.953 38.2585Z"
                    fill="#F8F8F8" />
            </svg>  

        </div>
        <div class="form-container">
           <!-- Edad -->
            <div class="form-group">
                <label for="edad">Edad</label>
                <input type="number" id="edad" name="edad" placeholder="Escribe tu edad" required min="1"
                    max="120" />
                <div class="error-message">Por favor ingresa una edad válida</div>
            </div>

            <!-- Descripción -->
            <div class="form-group">
                <label for="descripcion">Descripción</label>
                <textarea id="descripcion" name="descripcion" placeholder="Escribe la descripción del joven"
                    required minlength="10" maxlength="500"></textarea>
                <div class="error-message">Por favor escribe una descripción (mínimo 10 caracteres)</div>
            </div>

            <!-- Términos y Condiciones -->
            <div class="terms-section">
                <div class="checkbox-container">
                    <input type="checkbox" id="acceptTerms" required />
                    <label for="acceptTerms" class="checkbox-label">
                        Acepta nuestros <a href="#" class="terms-link">términos y condiciones</a>
                        y nuestra <a href="#" class="terms-link">política de privacidad</a> para continuar
                    </label>
                </div>
                <div class="error-message" id="termsError">
                    Debes aceptar los términos y condiciones para continuar
                </div>
            </div>

            <!-- btns step 3 -->
            <div class="button-container">
                <button type="button" class="btn btn-secondary" onclick="goBack()">
                    Regresar
                </button>
                <button type="submit" class="btn btn-primary" id="saveBtn">
                    Guardar
                </button>
            </div>
        </div>
      </div>
    </form>
    

    <script>
      // Referencias a elementos del DOM
      const steps = document.querySelectorAll(".step");
      const nextBtns = document.querySelectorAll(".nextBtn");
      const prevBtns = document.querySelectorAll(".prevBtn");
      const form = document.getElementById('multiStepForm');
      const fileInput = document.getElementById('fileInput');
      const fileUploadContainer = document.getElementById('fileUploadContainer');
      const filePreview = document.getElementById('filePreview');
      const fileName = document.getElementById('fileName');
      const fileSize = document.getElementById('fileSize');
      const fileRemove = document.getElementById('fileRemove');
      const fileError = document.getElementById('fileError');
      const nextBtn = document.getElementById('nextBtn');
      const saveBtn = document.getElementById('saveBtn');
      const successOverlay = document.getElementById('successOverlay');
      const countdownElement = document.getElementById('countdown');
      const termsError = document.getElementById('termsError');

      // Variables de control
      let currentStep = 0;

      // Datos del formulario almacenados en memoria
      let formData1 = {
          nombres: '',
          apellidos: '',
          direccion: '',
          telefono: ''
      };

      let formData2 = {
          pais: '',
          departamento: '',
          estado_civil: '',
          archivo: null
      };

      let formData3 = {
          edad: '',
          descripcion: '',
          acceptTerms: false
      };

      // Objeto para datos completos
      let completeFormData = {};

///////////////////// NAVIGATION FUNCTIONS //////////////////////////////////////////

      function showStep(step) {
          // Actualizar pasos activos
          steps.forEach((el, i) => el.classList.toggle("active", i === step));
          
          // Actualizar botón de submit en el último paso
          if (step === 2 && typeof updateSubmitButton === 'function') {
              updateSubmitButton();
          }
      }

      function next() {
          if (currentStep < steps.length - 1) {
              currentStep++;
              showStep(currentStep);
          }
      }

      function goBack() {
          if (currentStep > 0) {
              currentStep--;
              showStep(currentStep);
          }
      }

      function redirectToCheck() {
          window.location.href = 'check.php';
      }
      function goInicio() {
          window.location.href = 'index.php';
      }

///////////////////// FIN NAVIGATION FUNCTIONS ////////////////////

///////////////////// DATA FUNCTIONS //////////////////////////////////////////

  function saveFormData1() {
      const formElements = form.elements;
      
      formData1.nombres = formElements.nombres?.value.trim() || '';
      formData1.apellidos = formElements.apellidos?.value.trim() || '';
      formData1.direccion = formElements.direccion?.value.trim() || '';
      formData1.telefono = formElements.telefono?.value.trim() || '';
      
      // Guardar en completeFormData también
      Object.assign(completeFormData, formData1);
      
      console.log('Datos del Paso 1 guardados:', formData1);
  }

  function saveFormData2() {
      const formElements = form.elements;

      formData2.pais = formElements.pais?.value || '';
      formData2.departamento = formElements.departamento?.value || '';
      formData2.estado_civil = formElements.estado_civil?.value || '';

      // Guardar en completeFormData también
      Object.assign(completeFormData, formData2);
      
      // Si hay archivo, agregar información del archivo
      if (formData2.archivo) {
          completeFormData.archivoInfo = getFileInfo();
      }

      console.log('Datos del Paso 2 guardados:', formData2);
  }

  function saveFormData3() {
      const formElements = form.elements;

      formData3.edad = formElements.edad?.value || '';
      formData3.descripcion = formElements.descripcion?.value || '';
      formData3.acceptTerms = formElements.acceptTerms?.checked || false;

      // Guardar en completeFormData también
      Object.assign(completeFormData, formData3);

      console.log('Datos del Paso 3 guardados:', formData3);
  }

  function isFormComplete() {
    return completeFormData.nombres &&
        completeFormData.apellidos &&
        completeFormData.direccion &&
        completeFormData.telefono &&
        completeFormData.pais &&
        completeFormData.departamento &&
        completeFormData.estado_civil &&
        completeFormData.archivo && 
        completeFormData.edad &&
        completeFormData.descripcion &&
        completeFormData.acceptTerms;
}

///////////////////// FIN DATA FUNCTIONS //////////////////////////////////////////

///////////////////// VALIDATION FUNCTIONS //////////////////////////////////////////

function validateField(field) {
    const errorMsg = field.parentNode.querySelector('.error-message');
    const value = field.value?.trim() || '';
    let isValid = true;

    // Limpiar estados de error previos
    field.classList.remove('error', 'is-invalid');
    field.style.border = '';
    if (errorMsg) errorMsg.classList.remove('show');

    // Validar campos requeridos
    if (field.hasAttribute('required') && !value && field.type !== 'checkbox') {
        isValid = false;
        if (errorMsg) errorMsg.textContent = 'Este campo es obligatorio';
    }

    // Validaciones específicas por campo
    if (isValid && value) {
        switch (field.name) {
            case 'nombres':
            case 'apellidos':
                if (!/^[a-zA-ZáéíóúÁÉÍÓÚñÑ\s]+$/.test(value)) {
                    isValid = false;
                    if (errorMsg) errorMsg.textContent = 'Solo se permiten letras y espacios';
                }
                break;
                
            case 'telefono':
                if (!/^[+]?[\d\s\-\(\)]+$/.test(value)) {
                    isValid = false;
                    if (errorMsg) errorMsg.textContent = 'Formato de teléfono inválido';
                } else if (value.length < 7 || value.length > 15) {
                    isValid = false;
                    if (errorMsg) errorMsg.textContent = 'El teléfono debe tener entre 7 y 15 caracteres';
                }
                break;
                
            case 'direccion':
                if (value.length < 10) {
                    isValid = false;
                    if (errorMsg) errorMsg.textContent = 'La dirección debe tener al menos 10 caracteres';
                }
                break;

            case 'edad':
                const edad = parseInt(field.value);
                if (!field.value || edad < 1 || edad > 120) {
                    isValid = false;
                    if (errorMsg) errorMsg.textContent = 'Por favor ingresa una edad válida (1-120 años)';
                }
                break;

            case 'descripcion':
                if (field.value.trim().length < 10) {
                    isValid = false;
                    if (errorMsg) errorMsg.textContent = 'Por favor escribe una descripción (mínimo 10 caracteres)';
                } else if (field.value.length > 500) {
                    isValid = false;
                    if (errorMsg) errorMsg.textContent = 'La descripción no puede exceder 500 caracteres';
                }
                break;
        }
    }

    // Validación especial para checkbox de términos
    if (field.name === 'acceptTerms') {
        if (!field.checked) {
            isValid = false;
            if (termsError) {
                termsError.classList.add('show');
            }
        } else {
            if (termsError) {
                termsError.classList.remove('show');
            }
        }
    }

    // Aplicar estilos de error
    if (!isValid) {
        field.classList.add('error', 'is-invalid');
        field.style.border = '2px solid #ff4444';
        if (errorMsg && field.name !== 'acceptTerms') {
            errorMsg.classList.add('show');
        }
    }

    return isValid;
}

function validateFieldSelects(field) {
    const errorMsg = field.parentNode.parentNode.querySelector('.error-message') || 
                     field.parentNode.querySelector('.error-message');
    let isValid = true;

    // Limpiar estados previos
    field.classList.remove('error', 'is-invalid');
    if (errorMsg) errorMsg.classList.remove('show');

    if (field.hasAttribute('required') && field.value === '') {
        isValid = false;
        field.classList.add('error', 'is-invalid');
        if (errorMsg) {
            errorMsg.textContent = 'Por favor selecciona una opción';
            errorMsg.classList.add('show');
        }
    }

    return isValid;
}

function validateCurrentStep() {
    const currentStepElement = steps[currentStep];
    const inputs = currentStepElement.querySelectorAll("input, textarea");
    const selects = currentStepElement.querySelectorAll("select");
    let valid = true;
    
    // Validar inputs y textareas (excluyendo file inputs)
    inputs.forEach(input => {
        if (input.type !== 'file' && !validateField(input)) {
            valid = false;
        }
    });
    
    // Validar selects
    selects.forEach(select => {
        if (!validateFieldSelects(select)) {
            valid = false;
        }
    });
    
    // Validar archivo en el paso 2 si es necesario
    if (currentStep === 1 && typeof validateFileUpload === 'function') {
        if (!validateFileUpload()) {
            valid = false;
        }
    }
    
    return valid;
}

// Funciones de compatibilidad
function validateForm() {
    let isValid = true;
    const fields = form.querySelectorAll('input[required], textarea[required]');
    
    fields.forEach(field => {
        if (!validateField(field)) {
            isValid = false;
        }
    });

    return isValid;
}

function validateFormSelects() {
    let isValid = true;
    const selects = form.querySelectorAll('select[required]');

    selects.forEach(select => {
        if (!validateFieldSelects(select)) {
            isValid = false;
        }
    });

    return isValid;
}

function updateSubmitButton() {
    if (currentStep !== 2 || !saveBtn) return;
    
    const edad = document.getElementById('edad');
    const descripcion = document.getElementById('descripcion');
    const terms = document.getElementById('acceptTerms');
    
    if (!edad || !descripcion || !terms) return;

    const isFormValid = edad.value && 
                       descripcion.value.trim().length >= 10 && 
                       terms.checked;
                       
    saveBtn.disabled = !isFormValid;
}

//////////////////////FIN VALIDACION///////////////////////////////

///////////////////// FORM SUBMISSION //////////////////////////////////////////

  function handleFormSubmit(e) {
      e.preventDefault();
      
      // Validar el paso actual
      if (!validateCurrentStep()) {
          return;
      }
      
      // Acciones según el paso actual
      switch(currentStep) {
          case 0: // Step 1
              saveFormData1();
              next();
              break;
              
          case 1: // Step 2
              saveFormData2();
              next();
              break;
              
          case 2: // Step 3 (último paso)
              saveFormData3();
              submitForm();
              break;
      }
  }

  function submitForm() {
      // Mostrar estado de carga
      if (saveBtn) {
          saveBtn.textContent = '';
          saveBtn.classList.add('btn-loading');
          saveBtn.disabled = true;
      }

      // Añadir timestamp
      completeFormData.timestamp = new Date().toISOString();

      // envío al servidor
      setTimeout(() => {
          console.log('Enviando datos completos del formulario:', completeFormData);

          if (isFormComplete()) {
              if (typeof redirectToCheck === 'function') {
                  redirectToCheck();
              } else {
                  // Mostrar overlay de éxito si existe
                  if (successOverlay) {
                      successOverlay.style.display = 'flex';
                      startCountdown();
                  } else {
                      alert('Formulario enviado correctamente!');
                  }
              }
          } else {
              // En caso de error
              if (saveBtn) {
                  saveBtn.textContent = 'Guardar';
                  saveBtn.classList.remove('btn-loading');
                  saveBtn.disabled = false;
              }
              alert('Error al procesar el formulario. Por favor, inténtalo de nuevo.');
          }
      }, 2000);
  }

  function startCountdown() {
      if (!countdownElement) return;
      
      let seconds = 5;
      const interval = setInterval(() => {
          countdownElement.textContent = seconds;
          seconds--;
          
          if (seconds < 0) {
              clearInterval(interval);
              if (typeof redirectToCheck === 'function') {
                  redirectToCheck();
              }
          }
      }, 1000);
  }



///////////////////// EVENT LISTENERS //////////////////////////////////////////

  document.addEventListener('DOMContentLoaded', function() {
      // Event listener principal para el formulario
      if (form) {
          form.addEventListener('submit', handleFormSubmit);
      }
      
      // Event listeners para botones "Regresar"
      prevBtns.forEach(btn => {
          btn.addEventListener('click', function(e) {
              e.preventDefault();
              goBack();
          });
      });
      
      // Validación en tiempo real
      ['input', 'change', 'blur'].forEach(eventType => {
          form.addEventListener(eventType, function(e) {
              const target = e.target;
              
              if (eventType === 'input' && (target.tagName === 'INPUT' || target.tagName === 'TEXTAREA')) {
                  validateField(target);
                  updateSubmitButton();
              } else if ((eventType === 'change' || eventType === 'blur') && target.tagName === 'SELECT') {
                  validateFieldSelects(target);
                  updateSubmitButton();
              } else if (eventType === 'change' && target.type === 'checkbox') {
                  validateField(target);
                  updateSubmitButton();
              }
          });
      });
      
      // Contador de caracteres para descripción
      const descripcion = document.getElementById('descripcion');
      if (descripcion) {
          descripcion.addEventListener('input', function(e) {
              const current = e.target.value.length;
              const max = 500;
              const counter = document.querySelector('.char-counter');
              
              if (counter) {
                  counter.textContent = `${current}/${max}`;
                  counter.style.color = current > max ? '#ff4444' : '#666';
              }
              
              updateSubmitButton();
          });
      }
      
      // Mostrar el primer paso
      showStep(currentStep);
  });

//////////////////////MANEJO DE ARCHIVOS Y VALIDACION//////////////

       // Manejo de archivo y validaciones 
      fileInput.addEventListener('change', handleFileSelect);
      fileUploadContainer.addEventListener('dragover', handleDragOver);
      fileUploadContainer.addEventListener('drop', handleFileDrop);
      fileUploadContainer.addEventListener('dragleave', handleDragLeave);
      fileRemove.addEventListener('click', removeFile);

      
      function handleFileSelect(e) {
          const file = e.target.files[0];
          if (file) {
              validateAndDisplayFile(file);
          }
      }

      function handleDragOver(e) {
          e.preventDefault();
          fileUploadContainer.classList.add('dragover');
      }

      function handleDragLeave(e) {
          e.preventDefault();
          fileUploadContainer.classList.remove('dragover');
      }

      function handleFileDrop(e) {
          e.preventDefault();
          fileUploadContainer.classList.remove('dragover');

          const file = e.dataTransfer.files[0];
          if (file) {
              fileInput.files = e.dataTransfer.files;
              validateAndDisplayFile(file);
          }
      }

      function validateAndDisplayFile(file) {
          const maxSize = 20 * 1024 * 1024; // 20MB
          const allowedTypes = ['image/jpeg', 'image/jpg', 'image/png', 'application/pdf'];

          // Validar tipo
          if (!allowedTypes.includes(file.type)) {
              showFileError('Tipo de archivo no permitido. Solo se permiten imágenes (JPG, PNG) y PDF.');
              return;
          }

          // Validar tamaño
          if (file.size > maxSize) {
              showFileError('El archivo es demasiado grande. El tamaño máximo es 20MB.');
              return;
          }

          // Mostrar archivo válido
          displayFile(file);
          hideFileError();
      }

      function displayFile(file) {
          fileName.textContent = file.name;
          fileSize.textContent = formatFileSize(file.size);
          filePreview.classList.add('show');
          fileUploadContainer.style.display = 'none';
          formData.archivo = file;
      }

      function removeFile() {
          fileInput.value = '';
          filePreview.classList.remove('show');
          fileUploadContainer.style.display = 'flex';
          formData.archivo = null;
          hideFileError();
      }

      function showFileError(message) {
          fileError.textContent = message;
          fileError.classList.add('show');
          removeFile();
      }

      function hideFileError() {
          fileError.classList.remove('show');
      }

      function formatFileSize(bytes) {
          if (bytes === 0) return '0 Bytes';
          const k = 1024;
          const sizes = ['Bytes', 'KB', 'MB', 'GB'];
          const i = Math.floor(Math.log(bytes) / Math.log(k));
          return parseFloat((bytes / Math.pow(k, i)).toFixed(2)) + ' ' + sizes[i];
      }

//////////////////// fin MANEJO DE ARCHIVOS Y VALIDACION//////////////

/////////////////////FORMATEO////////////////////////////////////////

      // Formateo automático del teléfono
      document.getElementById('telefono').addEventListener('input', function(e) {
          let value = e.target.value.replace(/\D/g, '');
          
          // Formatear número telefónico (ejemplo para Colombia)
          if (value.length >= 10) {
              value = value.replace(/(\d{3})(\d{3})(\d{4})/, '$1 $2 $3');
          }
          
          e.target.value = value;
      });

///////////////////////FIN FORMATEO//////////////////////////////////

///////////////////// Servicio  //////////////////////////////////////////
      // cargar paises
      document.addEventListener("DOMContentLoaded", async () => {
        const paisSelect = document.getElementById("pais");
        const depSelect = document.getElementById("departamento");

        try {
          const resp = await fetch("https://countriesnow.space/api/v0.1/countries/positions");
          const json = await resp.json();

          if (!json || !Array.isArray(json.data)) {
            throw new Error("Respuesta inesperada de la API");
          }

          const countries = json.data.sort((a, b) => a.name.localeCompare(b.name));
          countries.forEach(country => {
            const option = document.createElement("option");
            option.value = country.name;
            option.textContent = country.name;
            paisSelect.appendChild(option);
          });
        } catch (err) {
          console.error("Error al cargar países:", err);
        }

        // cargar ciudades
        paisSelect.addEventListener("change", async (e) => {
          const country = e.target.value;
          depSelect.innerHTML = '<option value="" disabled selected>Cargando...</option>';

          try {
            const resp = await fetch("https://countriesnow.space/api/v0.1/countries/cities", {
              method: "POST",
              headers: { "Content-Type": "application/json" },
              body: JSON.stringify({ country })
            });

            const data = await resp.json();
            depSelect.innerHTML = '<option value="" disabled selected>Seleccione un departamento</option>';

            if (data.data && Array.isArray(data.data)) {
              data.data.sort().forEach(city => {
                const option = document.createElement("option");
                option.value = city;
                option.textContent = city;
                depSelect.appendChild(option);
              });
            }
          } catch (err) {
            console.error("Error al cargar ciudades:", err);
            depSelect.innerHTML = '<option value="" disabled selected>Error al cargar</option>';
          }
        });
      });
      

///////////////////// Fin Servicio  //////////////////////////////////////////
    </script>

  </body>
</html>